import React from "react";
import { Link } from "react-router-dom";
import "../stylesheets/Nav.scss";
import "../stylesheets/Global.scss";

export default function Nav() {
  return (
    <div>
      <nav>
        <div className="nav--items font-size-lg">
          <Link to="/" className="nav--links_home">
            Birte Spreuer
          </Link>
          <Link to="/projects" className="nav--links_projects">
            Projects
          </Link>
          <Link to="about" className="nav--links_about">
            About
          </Link>
          <Link to="contact" className="nav--links_contact">
            Contact
          </Link>
        </div>
      </nav>
    </div>
  );
}
